syntax = "proto3";

package com.tinder.profile.data;

option java_multiple_files = true;
option optimize_for = LITE_RUNTIME;
option java_package = "com.tinder.profile.data.generated.proto";

message ExploreSettingsValue {
    ExploreSettings value = 1;
}

message ExploreSettings {
    map<string, string> exploreDiscoverable = 1;
}
